if (check.length > 0) {
  var output = {
    message: []
  };

  // Get current timestamp
  var now = new Date();

  // Group the messages by header
  var groups = {};
  data.forEach(function (item) {
    // Parse the item's timestamp
    var timestamp = new Date(item.timestamp);

    // Calculate the time difference in milliseconds
    var diff = now.getTime() - timestamp.getTime();

    // Calculate the time difference in minutes, hours, and days
    var minutesDiff = Math.floor(diff / (1000 * 60));
    var hoursDiff = Math.floor(minutesDiff / 60);
    var daysDiff = Math.floor(hoursDiff / 24);

    // Prepare the message object for the item
    var messageObj = {
      id: item.id,
      userId: item.userId,
      avatar: item.avatar,
      title: item.title,
      acknowledge: item.acknowledge,
      timestamp: item.timestamp
    };

    // Categorize the item based on the time difference
    if (minutesDiff < 1440) { // Less than 24 hours (Today)
      if (!groups["Today"]) {
        groups["Today"] = [];
      }
      if (hoursDiff > 0) {
        var minutesRemainder = minutesDiff % 60;
        messageObj.subtitle = hoursDiff + " Hours " + minutesRemainder + " Minutes ago";
      } else {
        messageObj.subtitle = minutesDiff + " Minutes ago";
      }
      groups["Today"].push(messageObj);
    } else if (hoursDiff < 48) { // Between 24 and 48 hours (Yesterday)
      if (!groups["Yesterday"]) {
        groups["Yesterday"] = [];
      }
      messageObj.subtitle = hoursDiff + " Hours ago";
      groups["Yesterday"].push(messageObj);
    } else { // Older than 48 hours (Older)
      if (!groups["Older"]) {
        groups["Older"] = [];
      }
      messageObj.subtitle = daysDiff + " Days ago";
      groups["Older"].push(messageObj);
    }
  });

  // Sort the messages within each group by timestamp in ascending order
  Object.keys(groups).forEach(function (key) {
    groups[key].sort(function (a, b) {
      return new Date(b.timestamp).getTime() - new Date(a.timestamp).getTime();
    });
  })

  // Add the groups to the output in the specified order
  if (groups["Today"]) {
    output.message.push({ header: "Today" });
    output.message.push(...groups["Today"]);
  }
  if (groups["Yesterday"]) {
    output.message.push({ header: "Yesterday" });
    output.message.push(...groups["Yesterday"]);
  }
  if (groups["Older"]) {
    output.message.push({ header: "Older" });
    output.message.push(...groups["Older"]);
  }

  // Return the sorted output data object
  output
  // msg.payload = output;
  msg.payload = Object.assign(output, { status: true })
  return [msg, null]

  // Function to calculate the time difference
} else {
  msg.payload = { "message": [], status: true }
  return [null, msg]
}

