const head = msg.req.headers
if (!head.hasOwnProperty('authorization')) {
    msg.payload = { message: "Authorization header not found", status: false }
    return [null, msg]
}
const accessToken = msg.req.headers["authorization"].split(" ")[1]
// const checkHead = msg.req.headers["authorization"]
msg.data = msg.payload
msg.payload = accessToken
// return [null, msg]
if (accessToken == undefined || accessToken == "") {
    msg.payload = { message: "Access token is missing or invalid", status: false }
    return [null, msg]
} else {
    var joinField = [
        { "$match": { "access_token": { "$regex": accessToken } } }
    ]
    msg.accessToken = accessToken
    msg.url = "https://api.line.me/oauth2/v2.1/verify?access_token=" + accessToken
    msg.payload = [joinField]
    return [msg, null]
}

